import { createRouter, createWebHistory } from 'vue-router';
import App from '../App.vue';
import Shop from '../views/ShopPage.vue'; // ou '../views/Shop.vue' si tu le ranges ailleurs

const routes = [
  {
    path: '/',
    name: 'Home',
    component: HomePage,
  },
  {
    path: '/shop',
    name: 'Shop',
    component: Shop,
  },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
